import React from 'react';
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";
import LocalHospitalIcon from '@material-ui/icons/LocalHospital';
import EmojiFlagsIcon  from '@material-ui/icons/EmojiFlags';
import PeopleIcon from '@material-ui/icons/People';
import ChatIcon from '@material-ui/icons/Chat';
import StorefrontIcon from '@material-ui/icons/Storefront';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';


function Sidebar() {
    return (
        <div className='sidebar'>
            <SidebarRow title='Freddie' src='https://stargate.ncc.edu/~bla6003/personal-site/img/Icon2.png' />
            <SidebarRow title='COVID-19 Information Center' Icon={LocalHospitalIcon} />
            <SidebarRow Icon={EmojiFlagsIcon} title='Pages' />
            <SidebarRow title='Friends' Icon={PeopleIcon} />
            <SidebarRow title='Messenger' Icon={ChatIcon} />
            <SidebarRow title='Marketplace' Icon={StorefrontIcon} />
            <SidebarRow title='Videos' Icon={VideoLibraryIcon} />
            <SidebarRow title='Marketplace' Icon={ExpandMoreIcon} />
        </div>
    )
}

export default Sidebar
